const _hoisted_1 = /* @__PURE__ */ createStaticVNode('<hr><h2 id="一-redis-简介" tabindex="-1"><a class="header-anchor" href="#一-redis-简介" aria-hidden="true">#</a> 一, Redis 简介</h2><hr><h3 id="_1-什么是-redis" tabindex="-1"><a class="header-anchor" href="#_1-什么是-redis" aria-hidden="true">#</a> 1, 什么是 redis</h3><p><strong>Redis</strong>是由C语言编写的开源、基于内存、支持多种数据结构、高性能的<strong>Key-Value</strong>数据库。</p><p>Redis（Remote Dictionary Server）是一个开源的内存数据库和缓存系统，它以键值对（key-value）的形式存储数据。Redis支持多种数据结构，包括字符串、哈希表、列表、集合和有序集合等。</p><p>Redis被设计为高性能的键值存储系统，它的数据存储在内存中，因此具有非常快速的读写速度。同时，Redis还提供了持久化功能，可以将内存中的数据定期写入磁盘，以防止数据丢失。</p><p>Redis还具备其他功能，如发布订阅系统、事务支持、Lua脚本执行、分布式锁和地理空间索引等。它的特点包括简单、灵活、可扩展和高性能，使得它在缓存、会话存储、排行榜、消息队列、实时统计和分布式应用等场景中被广泛使用。</p><p>Redis提供了多种语言的客户端库，使得开发者可以使用各种编程语言与Redis进行交互，包括Java、Python、Node.js、C#等。通过这些客户端库，开发者可以方便地连接到Redis服务器并执行各种操作，如设置键值对、获取值、执行命令等。</p><p><strong>总结</strong></p><p>Redis是一个功能丰富、高性能的键值存储系统，广泛应用于缓存、数据存储和分布式应用等场景，以提供快速、可靠的数据存储和访问。</p><p><strong>Spring版本</strong></p><p>Spring 6</p>', 13);
